import PropTypes from "prop-types";

const Header = ({ title }) => {
  return (
    <header class="header">
      <h1>{title}</h1>
      <button>Add</button>
    </header>
  );
};

// Set default properties
Header.defaultProps = {
  title: "Task Tracker",
};

// Set property types
Header.propTypes = {
  title: PropTypes.string.isRequired,
};

// Pass CSS styling
// const headingStyle = {
//   color: "red",
//   backgroundColor: "black",
// };

export default Header;
